


CREATE TABLE zupanija
(
  sifZupanija SMALLINT NOT NULL,
  nazZupanija VARCHAR(40) NOT NULL,
  PRIMARY KEY (sifZupanija)
);

CREATE TABLE mjesto
(
  pBr INT NOT NULL,
  nazMjesto VARCHAR(40) NOT NULL,
  sifZupanija SMALLINT,
  PRIMARY KEY (pBr),
  FOREIGN KEY (sifZupanija) REFERENCES zupanija(sifZupanija)
);

CREATE TABLE dvorana
(
  oznDvorana VARCHAR(5) NOT NULL,
  kapacitet INT NOT NULL,
  PRIMARY KEY (oznDvorana)
);

CREATE TABLE orgjed
(
  sifOrgJed INT NOT NULL,
  nazOrgJed VARCHAR(120) NOT NULL,
  sifNadOrgJed INT,
  PRIMARY KEY (sifOrgJed)
  );

CREATE TABLE predmet
(
  sifPredmet INT NOT NULL,
  nazPredmet VARCHAR(60) NOT NULL,
  ECTSBod NUMERIC(4,1),
  ukBrSatiTjedno SMALLINT,
  PRIMARY KEY (sifPredmet)
);

CREATE TABLE grupa
(
  akGodina SMALLINT NOT NULL,
  oznGrupa VARCHAR(10) NOT NULL,
  kapacitet SMALLINT,
  PRIMARY KEY (akGodina, oznGrupa)
);

CREATE TABLE student
(
  JMBAG VARCHAR(10) NOT NULL,
  imeStudent VARCHAR(25) NOT NULL,
  prezimeStudent VARCHAR(25) NOT NULL,
  OIB VARCHAR(11),
  spol VARCHAR(1),
  datumRod DATE,
  pBrRodStudent INT,
  pBrStanStudent INT,
  PRIMARY KEY (JMBAG),
  FOREIGN KEY (pBrRodStudent) REFERENCES mjesto(pBr),
  FOREIGN KEY (pBrStanStudent) REFERENCES mjesto(pBr),
  UNIQUE (OIB)
);

CREATE TABLE nastavnik
(
  sifNastavnik INT NOT NULL,
  imeNastavnik VARCHAR(25) NOT NULL,
  prezimeNastavnik VARCHAR(25) NOT NULL,
  koef NUMERIC(3,2) NOT NULL,
  datumZaposlenOd DATE NOT NULL,
  datumZaposlenDo DATE,
  pBrStanNastavnik INT,
  sifOrgJed INT NOT NULL,
  PRIMARY KEY (sifNastavnik),
  FOREIGN KEY (pBrStanNastavnik) REFERENCES mjesto(pBr),
  FOREIGN KEY (sifOrgJed) REFERENCES orgjed(sifOrgJed)
);

CREATE TABLE predmetAkGod
(
  sifPredmet INT NOT NULL,
  akGodina SMALLINT NOT NULL,
  oznSemestar SMALLINT NOT NULL,
  PRIMARY KEY (sifPredmet, akGodina),
  FOREIGN KEY (sifPredmet) REFERENCES predmet(sifPredmet)
);

CREATE TABLE predmetGrupa
(
  sifPredmet INT NOT NULL,
  akGodina SMALLINT NOT NULL,
  oznGrupa VARCHAR(10) NOT NULL,
  sifNastavnik INT NOT NULL,
  oznDvorana VARCHAR(5),
  PRIMARY KEY (sifPredmet, akGodina, oznGrupa),
  FOREIGN KEY (sifPredmet, akGodina) REFERENCES predmetAkGod (sifPredmet, akGodina),
  FOREIGN KEY (akGodina, oznGrupa) REFERENCES grupa(akGodina, oznGrupa),
  FOREIGN KEY (sifNastavnik) REFERENCES nastavnik(sifNastavnik),
  FOREIGN KEY (oznDvorana) REFERENCES dvorana(oznDvorana)
);

CREATE TABLE upisanPredmet
(
  jmbag 		VARCHAR(10) 	NOT NULL,
  sifpredmet 	INTEGER 		NOT NULL,
  akgodina 	    SMALLINT 		NOT NULL,
  oznGrupa       VARCHAR(10) NOT NULL,
  PRIMARY KEY (jmbag, sifpredmet, akgodina),
  FOREIGN KEY (sifPredmet, akGodina, oznGrupa) REFERENCES predmetGrupa(sifPredmet, akGodina, oznGrupa),
  FOREIGN KEY (JMBAG) REFERENCES student(JMBAG)
);

CREATE TABLE evidencijaBoravka
(
  JMBAG VARCHAR(10) NOT NULL,
  datumVrijemePoc TIMESTAMP(0) NOT NULL,
  datumVrijemeKraj TIMESTAMP(0),
  oznDvorana VARCHAR(5) NOT NULL,
  PRIMARY KEY (datumVrijemePoc, JMBAG),
  FOREIGN KEY (JMBAG) REFERENCES student(JMBAG),
  FOREIGN KEY (oznDvorana) REFERENCES dvorana(oznDvorana)
);

CREATE TABLE IspitniRok
(
  sifPredmet INT NOT NULL,
  datumRok DATE NOT NULL,
  datumVrijemePrijava TIMESTAMP(0) NOT NULL,
  datumVrijemeOdjava TIMESTAMP(0) NOT NULL,
  PRIMARY KEY (datumRok, sifPredmet),
  FOREIGN KEY (sifPredmet) REFERENCES predmet(sifPredmet)
);

CREATE TABLE ispit
(
  JMBAG VARCHAR(10) NOT NULL,
  sifPredmet INT NOT NULL,
  datumRok DATE NOT NULL,
  datumIspit DATE,
  ocjena SMALLINT,
  sifNastavnik INT,
  PRIMARY KEY (sifPredmet, JMBAG, datumRok),
  FOREIGN KEY (JMBAG) REFERENCES student(JMBAG),
  FOREIGN KEY (datumRok, sifPredmet) REFERENCES IspitniRok(datumRok, sifPredmet),
  FOREIGN KEY (sifNastavnik) REFERENCES nastavnik(sifNastavnik)
);--data import 













 